import React from 'react';

import '../App.css';

{/* About page */}

function About() {
    return (
        <div>
            <p className = "App-font">Since 2019, we have been providing users and customers the best experience. At ToUpper LLC, we pride and distinguish ourselves by using the most modern technology when it comes to creating mobile or web applications. We know creating a website or mobile application for your business isn't easy, so let us help.

            Over the years, we have been helping all different kinds of businesses meet their goals.

We consult with businesses on what's best for their business. While consulting, we always make sure to provide the most elegant and easy to use application for your customers.

Let the geeks do the work for you! For any questions or comments, please contact us and we will be happy to respond as soon as possible!</p>
      </div>
    );
}

export default About;
